// ProductGrid.js
import React from 'react';
import Product from './Product';

const ProductGrid = ({ products }) => {
  return (
    <div className="grid-container">
      {products.map(product => (
        <Product key={product.id} product={product} />
      ))}
    </div>
  );
};

export default ProductGrid;
